import React, { useState, useEffect } from "react";
import "./main.css";
import "./keywords.css";
import { Link, useNavigate } from "react-router-dom";

function Keyword() {
  const [keyword, setKeyword] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const storedKeyword = localStorage.getItem("selectedKeyword");
    if (storedKeyword) setKeyword(storedKeyword);

    // Call backend story generation after previous steps
    const generateStory = async () => {
      try {
        const objects = JSON.parse(localStorage.getItem("detected_objects") || "[]");
        const keyword = localStorage.getItem("selectedKeyword");

        if (!keyword || objects.length === 0) return;

        const response = await fetch("http://127.0.0.1:5000/generate_story", {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ objects, keyword }),
        });

        const data = await response.json();
        localStorage.setItem("generated_story", data.story);
        console.log("Story saved ✅");
      } catch (error) {
        console.error("Error generating story:", error);
      }
    };

    setTimeout(generateStory, 5000); // simulate processing delay
  }, []);

  const handleChange = (e) => setKeyword(e.target.value);
  const handleSubmit = (e) => {
    e.preventDefault();
    localStorage.setItem("selectedKeyword", keyword);
    navigate("/processing");
  };
  const handleSelect = (value) => setKeyword(value);

  return (
    <div>
      <h1 className="top-heading">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
          width="50"
          height="55"
          alt="MoodMelody Logo"
        />{" "}
        MoodMelody
      </h1>

      <blockquote className="styled-quote">
        <p>
          <img
            src={`${process.env.PUBLIC_URL}/fyp-images/movie.webp`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="movie"
          />
          From Moments to Melodies — Create Stories from Your Videos...
        </p>
      </blockquote>

      <h2 className="main-heading">Add Your Inspiration Keyword</h2>

      <form className="keyword-form" onSubmit={handleSubmit}>
        <input
          type="text"
          className="keyword-input"
          placeholder="Enter a word that captures your video (e.g., adventure, peace...)"
          value={keyword}
          onChange={handleChange}
        />

        <div className="keyword-suggestions">
          <div className="row">
            <div className="col" onClick={() => handleSelect("Adventure")}>Adventure</div>
            <div className="col" onClick={() => handleSelect("Love")}>Love</div>
            <div className="col" onClick={() => handleSelect("Freedom")}>Freedom</div>
            <div className="col" onClick={() => handleSelect("Mystery")}>Mystery</div>
          </div>
          <div className="row-2">
            <div className="col" onClick={() => handleSelect("Joy")}>Joy</div>
            <div className="col" onClick={() => handleSelect("Peace")}>Peace</div>
            <div className="col" onClick={() => handleSelect("Memories")}>Memories</div>
          </div>
        </div>

        <button type="submit" className="keyword-btn">Submit</button>
      </form>

      <nav aria-label="Page navigation" className="page-nav">
        <ul className="pagination-nav">
          <li className="page-item">
            <Link to="/upload" className="page-link">Previous</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Keyword;
